import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";

import AccountCircleIcon from "@mui/icons-material/AccountCircle";
import {
  handleLogoutFalse,
  handleLogoutTrue,
} from "../../../features/HandleClickToAppearCheckoutForm";

// import {
//   handleLogoutFalse,
//   handleLogoutTrue,
// } from "../../features/HandleClickToAppearCheckoutForm";
const Logincomponent2 = () => {
  return (
    <Box>
      <Button className="icon_login">
        <AccountCircleIcon />
      </Button>
    </Box>
  );
};

export default Logincomponent2;
